import React from 'react';
import { Form } from 'react-bootstrap';
const Users = () => {
    return (
        <div>
            <h3>Login</h3>
            <Form.Control size="lg" type="text" placeholder="Large text" style={{ width: 500 }} />
            <br />
            <Form.Control size="lg" type="text" placeholder="Large text" style={{ width: 500 }} />
        </div>
    );
};

export default Users;
